const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover,
  },
  // hide last border
  "&:last-child td, &:last-child th": {
    border: 0,
  },
}));
const Customer = () => {
  return (
    <div>
      <Typography>Customer Order Details</Typography>
      <TableContainer component={Paper}>
        <Table aria-label="customized table">
          <TableHead>
            <TableRow>
              <StyledTableCell align="left">Sr.No</StyledTableCell>
              <StyledTableCell align="left">Customer Id</StyledTableCell>
              <StyledTableCell align="left">Customer Name</StyledTableCell>
              <StyledTableCell align="left">Address</StyledTableCell>
              <StyledTableCell align="left">Order Qty</StyledTableCell>
              <StyledTableCell align="left">Total Price</StyledTableCell>
              <StyledTableCell align="left">Mobile No</StyledTableCell>
              <StyledTableCell align="left">Delete Order</StyledTableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {() => (
              <StyledTableRow>
                <StyledTableCell component="th" scope="row">
                  {/* {index + 1} */}
                </StyledTableCell>
                <StyledTableCell align="left">
                  {/* SKU000{index + 1} */}
                </StyledTableCell>
                <StyledTableCell align="left">
                  {/* {stock.productname} */}
                </StyledTableCell>
                <StyledTableCell align="left"></StyledTableCell>

                <StyledTableCell align="left">
                  {/* {stock.totalQuantity} */}
                </StyledTableCell>
                <StyledTableCell align="left">
                  {/* {stock.totalprice} */}
                </StyledTableCell>
                <StyledTableCell align="left">
                  <Tooltip title="Delete">
                    <IconButton>
                      <DeleteIcon
                      // onClick={() => deleteProductHandler(index)}
                      />
                    </IconButton>
                  </Tooltip>
                </StyledTableCell>
              </StyledTableRow>
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};
export default Customer;
